
public class Parteuno {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=10;
		int b=5;
		System.out.println("Los números son: 10 y 5");
		System.out.println("Su suma es: " +(a+b));
		System.out.println("Su multiplicación es: " +(a*b));
		System.out.println("Su división es " +(a/b));
		System.out.println("Su módulo es " +(a%b));
		
		
		
		
	
	
	}

}
